import { Route, Link } from 'react-router-dom'

import AddQuote from './pages/AddQuote';
import AllQuotes from './pages/AllQuotes';
import Welcome from './pages/Welcome';

function App() {
  return (
    <div>
      <Route path="/welcome">
        <Welcome></Welcome>
      </Route>
      <Route path="/all-quotes">
        <AllQuotes></AllQuotes>
      </Route>
      <Route path="/add-quote">
        <AddQuote></AddQuote>
      </Route>
    </div>
  );
}

export default App;
